import React from 'react';
import Dialog from './functional/Dialog.js';
import getKey from './utils/KeyGenerator.js';

class LogDirectory extends React.Component {

    postDirectory = (localStorage.getItem("postDirectory") === null) ? [] : JSON.parse(localStorage.getItem("postDirectory"));
    postDirectory = (localStorage.getItem("postDirectory") === null) ? [] : JSON.parse(localStorage.getItem("postDirectory"));

    constructor(props) {
        super(props);
        this.title = props.title;
        this.message = props.message;
        this.sessionClick = this.sessionClick.bind(this);
    }
    sessionClick(item) {
        console.log(`sessionClick --> ${item}`)
    }
    months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sept", "Oct", "Nov", "Dec"]
    suffix = ["th", "st", "nd", "rd", "th", "th", "th", "th", "th", "th", "th"];
    items = () => this.postDirectory;
    logEntry = (logId) => JSON.parse(localStorage.getItem(logId));
    break = (logId) => this.logEntry(logId).Location.Break;
    day = (logId) => this.logEntry(logId).Day.Day;
    month = (logId) => this.months[this.logEntry(logId).Day.Month-1];
    year = (logId) => this.logEntry(logId).Day.Year;
    conditions = (logId) => this.logEntry(logId).Conditions.Conditions;

    sessions = () => this.items().map((item) => {
        return <div key={getKey("log")} className="flexContainer width-100-percent greet color-yellow bg-dk-yellow m-1 r-10" onClick={this.sessionClick(item)}>
                 <div className="flex3ColumnRight p-10">
                    {this.month(item) + " " + this.day(item) + this.suffix[Number(String(this.day(item)).slice(-1))] /*+ " " + this.year(item)*/ + ": "}
                 </div>
                 <div className="flex3Column p-10">
                    {this.break(item)}
                 </div>
                 <div className="flex3ColumnLeft p-10">
                    {" => " + this.conditions(item)}
                 </div>
                    {
                        //item.substring(3, 6) + ", " + 
                        //item.substring(6, item.indexOf("20")) + " " + 
                        //item.substring(item.indexOf("20"), item.indexOf("20")+4) + " " + 
                        //item.substring(item.length-2, item.length) + 
                    }
            </div>
    })
    render() {
        return (
            <div className="App-content fadeIn">
                <div className="flex3Column"></div>
                <div className="flex3Column">
                    <div className="bigHeader">Log Directory</div>
                    {this.sessions()}
                </div>
                <div className="flex3Column"></div>
            </div>
        );
    };
}

export default LogDirectory;
